import React from "react";
import Form from "../form/Form";
import { withRouter } from "react-router-dom";
import Button from "../button/Button";

const Inquiry = (props) => {
  const massiv = [];
  massiv.length = 7;
  const changed_fnc = (event) => {
    massiv[event.target.id] = event.target.value;
  };
  const clk = () => {
    props.history.push({
      pathname: "/api/showdata",
      ugugdul: "inquiry",
    });
  };

  return (
    <div className="pagez">
      <h1>Гүйлгээ</h1>
      <div className="form_holder">
        <Form changed={changed_fnc} placeholder="checksum" id="1" />
        <Form placeholder="transaction_id" id="2" />
      </div>
      <Button onclk={clk} whichcomp="inquiry"></Button>
    </div>
  );
};

export default withRouter(Inquiry);
